    "cyclistic_data %>%\n",
    "  count(usertype, bike_id, name = \"total_rides\") %>%\n",
    "  \n",
    "  ggplot(aes(x = bike_id, y = total_rides, fill = usertype)) +\n",
    "  geom_col(position = position_dodge(0.8), width = 0.7) +\n",
    "  geom_text(\n",
    "    aes(label = format(total_rides, big.mark = \",\")),\n",
    "    position = position_dodge(0.8), \n",
    "    vjust = -0.5, \n",
    "    size = 3.5\n",
    "  ) +\n",
    "  labs(\n",
    "    title = \"Bike Type Usage by Rider Category\",\n",
    "    x = \"Bike Type\",\n",
    "    y = \"Number of Rides\",\n",
    "    fill = \"Rider Type\"\n",
    "  ) +\n",
    "  scale_y_continuous(labels = ~ format(.x, big.mark = \",\")) + \n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5, face = \"bold\"),\n",
    "    legend.position = \"top\"\n",
    "  )"
   ]
