   "source": [
    "duration_plot <- cyclistic_data %>%\n",
    "  group_by(usertype) %>%\n",
    "  summarise(avg_duration = mean(ride_length)) %>% \n",
    "  ggplot(aes(x = usertype, y = avg_duration, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\",  width = 0.3) + \n",
    "  geom_text(\n",
    "    aes(label = format(round(avg_duration,2), big.mark = \",\")),\n",
    "    position = position_dodge(0.8), \n",
    "    vjust = -0.5\n",
    "  ) +\n",
    "  labs(\n",
    "    title = \"Average Ride Duration by User Type\",\n",
    "    x = \"User Type\",\n",
    "    y = \"Average Ride Duration in Minutes\"\n",
    "  ) +\n",
    "  theme_minimal()+\n",
    "  theme(\n",
    "      plot.title = element_text(\n",
    "          hjust = 0.5,\n",
    "          size = 16,\n",
    "          face = \"bold\"\n",
    "      ),\n",
    "      legend.position = \"none\"\n",
    "\n",
    "  )\n",
    "\n",
    "print(duration_plot)"
   ]
