    "cyclistic_data %>%\n",
    "  count(usertype, day_of_week) %>%\n",
    "  ggplot(aes(x = day_of_week, y = n, color = usertype)) +\n",
    "  geom_point(aes(size=n)) + \n",
    "  scale_y_continuous(labels = scales::comma) +\n",
    "  labs(\n",
    "    title = \"Weekly Ride Patterns\",\n",
    "    x = \"Day of Week\",\n",
    "    y = \"Amount of Rides\"\n",
    "  )+\n",
    "  theme(\n",
    "      plot.title = element_text(\n",
    "          hjust = 0.5,\n",
    "          size = 16,\n",
    "          face = \"bold\"\n",
    "      ))+\n",
    "  guides(size = \"none\") \n",
    "\n",
    "\n"
   ]
