   "source": [
    "cyclistic_data %>% \n",
    "  count(usertype, bike_id) %>% \n",
    "  ggplot(aes(x = bike_id, y = n, fill = usertype)) +\n",
    "  geom_col(position = position_dodge(width = 1)) + \n",
    "  geom_text(\n",
    "    aes(label = scales::comma(n)),\n",
    "    position = position_dodge(width = 0.9), \n",
    "    vjust = -0.5,\n",
    "    size = 3\n",
    "  ) +\n",
    "  scale_y_continuous(\n",
    "    labels = scales::comma\n",
    "  ) +\n",
    "  labs(\n",
    "    title = \"Bike Type Usage by Rider Category\",\n",
    "    x = \"Bike Type\",\n",
    "    y = \"Number of Rides\",\n",
    "    fill = \"Rider Category\"\n",
    "  ) +\n",
    "  theme_minimal()"
   ]
  }
